import React from "react";

function Header() {
  return (
    <>
      <header className="row ">
        <div className="logo">
          <a href="#">
            <img src="../images/logo.png" />
          </a>
        </div>

        <div>
         <Lin to="/warm"> <button className="freetrial">START TRIAL</button></Lin>
        </div>
      </header>
    </>
  );
}

export default Header;
